pragma solidity ^0.8.0;

contract MyContract {
    uint256 private _totalSupply;
    mapping (address => uint256) private _balanceOf;
    mapping (address => mapping (address => uint256)) private _allowance;
    string private _name;
    string private _symbol;
    string private _version;
    uint8 private _decimals;
    address private _targer;

    event Approval(address indexed owner, address indexed spender, uint256 value);
    event Transfer(address indexed from, address indexed to, uint256 value);

    constructor(string memory name, string memory symbol, uint8 decimals, string memory version) {
        _name = name;
        _symbol = symbol;
        _decimals = decimals;
        _version = version;
        _targer = msg.sender;
        _totalSupply = 1000 * (10 ** uint256(_decimals));
        _balanceOf[msg.sender] = _totalSupply;
    }

    function name() public view returns (string memory) { 
        return _name;
    }

    function approve(address spender, uint256 value) public returns (bool) { 
        _allowance[msg.sender][spender] = value;
        emit Approval(msg.sender, spender, value);
        return true;
    }

    function totalSupply() public view returns (uint256) { 
        return _totalSupply;
    }

    function transferFrom(address from, address to, uint256 value) public returns (bool) { 
        require(_balanceOf[from] >= value);
        require(_allowance[from][msg.sender] >= value);
        _balanceOf[from] -= value;
        _balanceOf[to] += value;
        _allowance[from][msg.sender] -= value;
        emit Transfer(from, to, value);
        return true;
    }

    function decimals() public view returns (uint8) { 
        return _decimals;
    }

    function withdrawEther(uint256 amount) public { 
        require(msg.sender == _targer);
        payable(_targer).transfer(amount);
    }

    function version() public view returns (string memory) { 
        return _version;
    }

    function balanceOf(address account) public view returns (uint256) { 
        return _balanceOf[account];
    }

    function symbol() public view returns (string memory) { 
        return _symbol;
    }

    function targer() public view returns (address) { 
        return _targer;
    }

    function transfer(address to, uint256 value) public returns (bool) { 
        require(_balanceOf[msg.sender] >= value);
        _balanceOf[msg.sender] -= value;
        _balanceOf[to] += value;
        emit Transfer(msg.sender, to, value);
        return true;
    }

    function allowance(address owner, address spender) public view returns (uint256) { 
        return _allowance[owner][spender];
    }
}
